(1, 'About Us', '<p><strong>Contact Details:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp; Skype</strong> : <strong>contact@dsinfoway.com</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp; Service Desk: http://</strong><strong>dsinfoway.com/ticket</strong></p>\r\n', 'معلومات عنا', '<p>بيانات المتصل:</p>\r\n\r\n<p>&nbsp; &nbsp; سكايب: contact@dsinfoway.com</p>\r\n\r\n<p>&nbsp; &nbsp; مكتب الخدمة: http://dsinfoway.com/ticket</p>\r\n', '0000-00-00 00:00:00', '2020-08-20 05:56:53', 0, 1, 0),
(3, 'Contact Us', '<p><strong>Contact Details:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp; Skype</strong> : <strong>contact@dsinfoway.com</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp; Service Desk: http://</strong><strong>dsinfoway.com/ticket</strong></p>\r\n', 'اتصل بنا', '<p>بيانات المتصل:</p>\r\n\r\n<p>&nbsp; &nbsp; سكايب: contact@dsinfoway.com</p>\r\n\r\n<p>&nbsp; &nbsp; مكتب الخدمة: http://dsinfoway.com/ticket</p>\r\n', '0000-00-00 00:00:00', '2020-08-20 05:01:53', 0, 1, 0),
(5, 'Terms and Condtions', '<h2>Who we are</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>Our website address is: http://example.com</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>What personal data we collect and why we collect it</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Comments</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&rsquo;s IP address and browser user agent string to help spam detection.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Media</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Contact forms</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Cookies</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Embedded content from other websites</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Analytics</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading --></p>\r\n\r\n<h2>Who we share your data with</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading --></p>\r\n\r\n<h2>How long we retain your data</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>What rights you have over your data</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>Where we send your data</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>Visitor comments may be checked through an automated spam detection service.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>Your contact information</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading --></p>\r\n\r\n<h2>Additional information</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>How we protect your data</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>What data breach procedures we have in place</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>What third parties we receive data from</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>What automated decision making and/or profiling we do with user data</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Industry regulatory disclosure requirements</h3>\r\n', 'الأحكام والشروط', '<p>من نحن<br />\r\nعنوان موقعنا على الويب هو: http://example.com</p>\r\n\r\n<p>ما هي البيانات الشخصية التي نجمعها ولماذا نقوم بجمعها<br />\r\nتعليقات<br />\r\nعندما يترك الزائرون تعليقاتهم على الموقع ، نجمع البيانات الموضحة في نموذج التعليقات ، وكذلك عنوان IP الخاص بالزائر وسلسلة وكلاء متصفح المستخدم للمساعدة في اكتشاف الرسائل غير المرغوب فيها.</p>\r\n\r\n<p>قد يتم توفير سلسلة مجهولة المصدر تم إنشاؤها من عنوان بريدك الإلكتروني (وتسمى أيضًا التجزئة) لخدمة Gravatar لمعرفة ما إذا كنت تستخدمها. سياسة خصوصية خدمة Gravatar متاحة هنا: https://automattic.com/privacy/. بعد الموافقة على تعليقك ، ستكون صورة ملفك الشخصي مرئية للجمهور في سياق تعليقك.</p>\r\n\r\n<p>وسائل الإعلام<br />\r\nإذا قمت بتحميل الصور إلى موقع الويب ، فيجب تجنب تحميل الصور مع تضمين بيانات الموقع المضمنة (EXIF GPS). يمكن لزوار الموقع تنزيل واستخراج أي بيانات موقع من الصور الموجودة على الموقع.</p>\r\n\r\n<p>نماذج الاتصال<br />\r\nبسكويت<br />\r\nإذا تركت تعليقًا على موقعنا ، فيمكنك الاشتراك في حفظ اسمك وعنوان بريدك الإلكتروني وموقعك الإلكتروني في ملفات تعريف الارتباط. هذه لراحتك حتى لا تضطر إلى ملء التفاصيل الخاصة بك مرة أخرى عندما تترك تعليقًا آخر. ستستمر ملفات تعريف الارتباط هذه لمدة عام واحد.</p>\r\n\r\n<p>إذا كان لديك حساب وقمت بتسجيل الدخول إلى هذا الموقع ، فسنقوم بتعيين ملف تعريف ارتباط مؤقت لتحديد ما إذا كان متصفحك يقبل ملفات تعريف الارتباط. لا يحتوي ملف تعريف الارتباط هذا على بيانات شخصية ويتم تجاهله عند إغلاق المستعرض الخاص بك.</p>\r\n\r\n<p>عند تسجيل الدخول ، سنقوم أيضًا بإعداد العديد من ملفات تعريف الارتباط لحفظ معلومات تسجيل الدخول الخاصة بك وخيارات عرض الشاشة. تستمر ملفات تعريف الارتباط لتسجيل الدخول لمدة يومين ، بينما تستمر ملفات تعريف ارتباط خيارات الشاشة لمدة عام. إذا حددت &quot;تذكرني&quot; ، فسيستمر تسجيل دخولك لمدة أسبوعين. إذا قمت بتسجيل الخروج من حسابك ، فستتم إزالة ملفات تعريف الارتباط الخاصة بتسجيل الدخول.</p>\r\n\r\n<p>إذا قمت بتحرير أو نشر مقال ، فسيتم حفظ ملف تعريف ارتباط إضافي في متصفحك. لا يتضمن ملف تعريف الارتباط هذا أي بيانات شخصية ويشير ببساطة إلى معرّف المشاركة للمقالة التي حررتها للتو. تنتهي صلاحيته بعد يوم واحد.</p>\r\n\r\n<p>محتوى مضمن من مواقع أخرى<br />\r\nقد تتضمن المقالات الموجودة على هذا الموقع محتوى مضمنًا (مثل مقاطع الفيديو والصور والمقالات وما إلى ذلك). يتصرف المحتوى المضمن من مواقع الويب الأخرى بنفس الطريقة تمامًا كما لو كان الزائر قد زار موقع الويب الآخر.</p>\r\n\r\n<p>قد تجمع مواقع الويب هذه بيانات عنك ، وتستخدم ملفات تعريف الارتباط ، وتضمين تتبعًا إضافيًا لجهة خارجية ، وتراقب تفاعلك مع هذا المحتوى المضمن ، بما في ذلك تتبع تفاعلك مع المحتوى المضمن إذا كان لديك حساب وتم تسجيل دخولك إلى هذا الموقع.</p>\r\n\r\n<p>تحليلات<br />\r\nمع من نشارك بياناتك<br />\r\nكم من الوقت نحتفظ ببياناتك<br />\r\nإذا تركت تعليقًا ، فسيتم الاحتفاظ بالتعليق والبيانات الوصفية الخاصة به إلى أجل غير مسمى. هذا حتى نتمكن من التعرف على أي تعليقات متابعة والموافقة عليها تلقائيًا بدلاً من الاحتفاظ بها في قائمة انتظار الإشراف.</p>\r\n\r\n<p>بالنسبة للمستخدمين الذين قاموا بالتسجيل على موقعنا (إن وجد) ، نقوم أيضًا بتخزين المعلومات الشخصية التي يقدمونها في ملف تعريف المستخدم الخاص بهم. يمكن لجميع المستخدمين رؤية معلوماتهم الشخصية أو تعديلها أو حذفها في أي وقت (باستثناء أنه لا يمكنهم تغيير اسم المستخدم الخاص بهم). يمكن لمسؤولي مواقع الويب أيضًا رؤية هذه المعلومات وتحريرها.</p>\r\n\r\n<p>ما هي الحقوق التي لديك على بياناتك<br />\r\nإذا كان لديك حساب على هذا الموقع ، أو تركت تعليقات ، فيمكنك طلب تلقي ملف مُصدَّر من البيانات الشخصية التي نحتفظ بها عنك ، بما في ذلك أي بيانات قدمتها إلينا. يمكنك أيضًا أن تطلب منا مسح أي بيانات شخصية نحتفظ بها عنك. هذا لا يشمل أي بيانات نحن ملزمون بالحفاظ عليها لأغراض إدارية أو قانونية أو أمنية.</p>\r\n\r\n<p>أين نرسل بياناتك<br />\r\nيمكن التحقق من تعليقات الزوار من خلال خدمة الكشف عن الرسائل غير المرغوب فيها تلقائيًا.</p>\r\n\r\n<p>معلومات الاتصال الخاصة بك<br />\r\nمعلومة اضافية<br />\r\nكيف نحمي بياناتك<br />\r\nما هي إجراءات خرق البيانات التي لدينا<br />\r\nما هي الأطراف الثالثة التي نتلقى البيانات منها<br />\r\nما صنع القرار الآلي و / أو التنميط الذي نقوم به مع بيانات المستخدم<br />\r\nمتطلبات الإفصاح التنظيمي للصناعة</p>\r\n', '0000-00-00 00:00:00', '2020-08-20 05:39:51', 0, 1, 0),
(7, 'Privacy Policy', '<p><!-- wp:heading --></p>\r\n\r\n<h2>Who we are</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>Our website address is: http://example.com</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>What personal data we collect and why we collect it</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Comments</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&rsquo;s IP address and browser user agent string to help spam detection.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Media</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Contact forms</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Cookies</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Embedded content from other websites</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Analytics</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading --></p>\r\n\r\n<h2>Who we share your data with</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading --></p>\r\n\r\n<h2>How long we retain your data</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:paragraph --></p>\r\n\r\n<p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>What rights you have over your data</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>Where we send your data</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:paragraph --></p>\r\n\r\n<p>Visitor comments may be checked through an automated spam detection service.</p>\r\n\r\n<p><!-- /wp:paragraph --><!-- wp:heading --></p>\r\n\r\n<h2>Your contact information</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading --></p>\r\n\r\n<h2>Additional information</h2>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>How we protect your data</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>What data breach procedures we have in place</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>What third parties we receive data from</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>What automated decision making and/or profiling we do with user data</h3>\r\n\r\n<p><!-- /wp:heading --><!-- wp:heading {\"level\":3} --></p>\r\n\r\n<h3>Industry regulatory disclosure requirements</h3>\r\n\r\n<p><!-- /wp:heading --></p>\r\n', 'سياسة خاصة', '<p>من نحن<br />\r\nعنوان موقعنا على الويب هو: http://example.com</p>\r\n\r\n<p>ما هي البيانات الشخصية التي نجمعها ولماذا نقوم بجمعها<br />\r\nتعليقات<br />\r\nعندما يترك الزائرون تعليقاتهم على الموقع ، نجمع البيانات الموضحة في نموذج التعليقات ، وكذلك عنوان IP الخاص بالزائر وسلسلة وكلاء متصفح المستخدم للمساعدة في اكتشاف الرسائل غير المرغوب فيها.</p>\r\n\r\n<p>قد يتم توفير سلسلة مجهولة المصدر تم إنشاؤها من عنوان بريدك الإلكتروني (وتسمى أيضًا التجزئة) لخدمة Gravatar لمعرفة ما إذا كنت تستخدمها. سياسة خصوصية خدمة Gravatar متاحة هنا: https://automattic.com/privacy/. بعد الموافقة على تعليقك ، ستكون صورة ملفك الشخصي مرئية للجمهور في سياق تعليقك.</p>\r\n\r\n<p>وسائل الإعلام<br />\r\nإذا قمت بتحميل الصور إلى موقع الويب ، فيجب تجنب تحميل الصور مع تضمين بيانات الموقع المضمنة (EXIF GPS). يمكن لزوار الموقع تنزيل واستخراج أي بيانات موقع من الصور الموجودة على الموقع.</p>\r\n\r\n<p>نماذج الاتصال<br />\r\nبسكويت<br />\r\nإذا تركت تعليقًا على موقعنا ، فيمكنك الاشتراك في حفظ اسمك وعنوان بريدك الإلكتروني وموقعك الإلكتروني في ملفات تعريف الارتباط. هذه لراحتك حتى لا تضطر إلى ملء التفاصيل الخاصة بك مرة أخرى عندما تترك تعليقًا آخر. ستستمر ملفات تعريف الارتباط هذه لمدة عام واحد.</p>\r\n\r\n<p>إذا كان لديك حساب وقمت بتسجيل الدخول إلى هذا الموقع ، فسنقوم بتعيين ملف تعريف ارتباط مؤقت لتحديد ما إذا كان متصفحك يقبل ملفات تعريف الارتباط. لا يحتوي ملف تعريف الارتباط هذا على بيانات شخصية ويتم تجاهله عند إغلاق المستعرض الخاص بك.</p>\r\n\r\n<p>عند تسجيل الدخول ، سنقوم أيضًا بإعداد العديد من ملفات تعريف الارتباط لحفظ معلومات تسجيل الدخول الخاصة بك وخيارات عرض الشاشة. تستمر ملفات تعريف الارتباط لتسجيل الدخول لمدة يومين ، بينما تستمر ملفات تعريف ارتباط خيارات الشاشة لمدة عام. إذا حددت &quot;تذكرني&quot; ، فسيستمر تسجيل دخولك لمدة أسبوعين. إذا قمت بتسجيل الخروج من حسابك ، فستتم إزالة ملفات تعريف الارتباط الخاصة بتسجيل الدخول.</p>\r\n\r\n<p>إذا قمت بتحرير أو نشر مقال ، فسيتم حفظ ملف تعريف ارتباط إضافي في متصفحك. لا يتضمن ملف تعريف الارتباط هذا أي بيانات شخصية ويشير ببساطة إلى معرّف المشاركة للمقالة التي حررتها للتو. تنتهي صلاحيته بعد يوم واحد.</p>\r\n\r\n<p>محتوى مضمن من مواقع أخرى<br />\r\nقد تتضمن المقالات الموجودة على هذا الموقع محتوى مضمنًا (مثل مقاطع الفيديو والصور والمقالات وما إلى ذلك). يتصرف المحتوى المضمن من مواقع الويب الأخرى بنفس الطريقة تمامًا كما لو كان الزائر قد زار موقع الويب الآخر.</p>\r\n\r\n<p>قد تجمع مواقع الويب هذه بيانات عنك ، وتستخدم ملفات تعريف الارتباط ، وتضمين تتبعًا إضافيًا لجهة خارجية ، وتراقب تفاعلك مع هذا المحتوى المضمن ، بما في ذلك تتبع تفاعلك مع المحتوى المضمن إذا كان لديك حساب وتم تسجيل دخولك إلى هذا الموقع.</p>\r\n\r\n<p>تحليلات<br />\r\nمع من نشارك بياناتك<br />\r\nكم من الوقت نحتفظ ببياناتك<br />\r\nإذا تركت تعليقًا ، فسيتم الاحتفاظ بالتعليق والبيانات الوصفية الخاصة به إلى أجل غير مسمى. هذا حتى نتمكن من التعرف على أي تعليقات متابعة والموافقة عليها تلقائيًا بدلاً من الاحتفاظ بها في قائمة انتظار الإشراف.</p>\r\n\r\n<p>بالنسبة للمستخدمين الذين قاموا بالتسجيل على موقعنا (إن وجد) ، نقوم أيضًا بتخزين المعلومات الشخصية التي يقدمونها في ملف تعريف المستخدم الخاص بهم. يمكن لجميع المستخدمين رؤية معلوماتهم الشخصية أو تعديلها أو حذفها في أي وقت (باستثناء أنه لا يمكنهم تغيير اسم المستخدم الخاص بهم). يمكن لمسؤولي مواقع الويب أيضًا رؤية هذه المعلومات وتحريرها.</p>\r\n\r\n<p>ما هي الحقوق التي لديك على بياناتك<br />\r\nإذا كان لديك حساب على هذا الموقع ، أو تركت تعليقات ، فيمكنك طلب تلقي ملف مُصدَّر من البيانات الشخصية التي نحتفظ بها عنك ، بما في ذلك أي بيانات قدمتها إلينا. يمكنك أيضًا أن تطلب منا مسح أي بيانات شخصية نحتفظ بها عنك. هذا لا يشمل أي بيانات نحن ملزمون بالحفاظ عليها لأغراض إدارية أو قانونية أو أمنية.</p>\r\n\r\n<p>أين نرسل بياناتك<br />\r\nيمكن التحقق من تعليقات الزوار من خلال خدمة الكشف عن الرسائل غير المرغوب فيها تلقائيًا.</p>\r\n\r\n<p>معلومات الاتصال الخاصة بك<br />\r\nمعلومة اضافية<br />\r\nكيف نحمي بياناتك<br />\r\nما هي إجراءات خرق البيانات التي لدينا<br />\r\nما هي الأطراف الثالثة التي نتلقى البيانات منها<br />\r\nما صنع القرار الآلي و / أو التنميط الذي نقوم به مع بيانات المستخدم<br />\r\nمتطلبات الإفصاح التنظيمي للصناعة</p>\r\n', '0000-00-00 00:00:00', '2020-08-20 05:03:58', 0, 1, 0);
