INSERT INTO `email_templates` (`template_id`, `email_subject_en`, `email_message_en`, `email_subject_ar`, `email_message_ar`, `email_tags`, `created_at`, `modified_at`, `created_by`, `modified_by`, `draft`, `lang`) VALUES
(1, 'New App User Registration', '<p>Hi&nbsp;##user_full_name##,</p>\r\n\r\n<p>Welcome and thanks for registering with <strong>Mama Africa Takeaway</strong> food order app.</p>\r\n\r\n<p>You may use your phone number&nbsp;##user_phone## and the password you entered during registration to access the app.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>The App Team</p>\r\n', 'Thanks for New User', '<p>Hi&nbsp;##user_full_name##,</p>\r\n\r\n<p>Thanks for register with FOOD ORDER. You may use your phone number&nbsp;##user_phone## for access app.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,</p>\r\n', 'user_phone, user_full_name', '0000-00-00 00:00:00', '2021-01-07 00:37:55', 0, 1, 0, 'english'),
(2, 'Order Received Email', '<p>Hi,</p>\r\n\r\n<p>Your order placed successfully</p>\r\n\r\n<p>##order_details##</p>\r\n', 'Order Received Email', '<p>Hi,</p>\r\n\r\n<p>Your order placed successfully</p>\r\n\r\n<p>##order_details##</p>\r\n', 'order_details', '0000-00-00 00:00:00', '2021-01-07 00:57:49', 0, 1, 0, 'arabic'),
(3, 'New User Registration', '<p>Hi App Team,</p>\r\n\r\n<p>A new user registered with Mama Africa Takeaway App.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Full Name</td>\r\n			<td>##user_full_name##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phone</td>\r\n			<td>##user_phone##</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', 'Admin New User Received', '<p>Hi Food Order,</p>\r\n\r\n<p>New User registered with APP.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Full Name</td>\r\n			<td>##user_full_name##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phone</td>\r\n			<td>##user_phone##</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'user_phone, user_full_name', '0000-00-00 00:00:00', '2021-01-07 00:42:48', 0, 1, 0, 'english'),
(4, 'New Food Order Received', '<p>Hi Mama Afirca,</p>\r\n\r\n<p>You received new Order from Mama Africa Takeaway ordering app</p>\r\n\r\n<p>##order_details##</p>\r\n', 'Admin New Order Received', '<p>Hi Food Order,</p>\r\n\r\n<p>You received new Order.&nbsp;</p>\r\n\r\n<p>##order_details##</p>\r\n', 'order_details', '0000-00-00 00:00:00', '2021-01-07 00:17:52', 0, 1, 0, 'arabic'),
(5, 'Contact Request', '<p>Hi FOOD ORDER,</p>\r\n\r\n<p>You received new contact request. Please follow them.&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Full Name</td>\r\n			<td>##full_name##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phone</td>\r\n			<td>##phone##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Date</td>\r\n			<td>##date_time##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Message</td>\r\n			<td>##message##</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks.</p>\r\n', 'Contact Request', '<p>Hi FOOD ORDER,</p>\r\n\r\n<p>You received new contact request. Please follow them.&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Full Name</td>\r\n			<td>##full_name##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Phone</td>\r\n			<td>##phone##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Date</td>\r\n			<td>##date_time##</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Message</td>\r\n			<td>##message##</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks.</p>\r\n', 'full_name,phone,message,date_time', '0000-00-00 00:00:00', '2020-07-25 10:37:57', 0, 1, 0, 'arabic'),
(6, 'Reply Contact Request', '<p>Hi&nbsp;##full_name##,</p>\r\n\r\n<p>Thanks for contact FOOD ORDER, we will contact you soon.&nbsp;</p>\r\n', 'Reply Contact Request', '<p>Hi&nbsp;##full_name##,</p>\r\n\r\n<p>Thanks for contact FOOD ORDER, we will contact you soon.&nbsp;</p>\r\n', 'full_name,phone,message,date_time', '0000-00-00 00:00:00', '2020-07-25 10:17:57', 0, 1, 0, 'arabic');
